     &           MNeu(Neu3)*
     &           Re(B0(Mf2(2,gno1),MASf2(All3,2),MNeu2(Neu3))) + 
     &          (dup45*dup48*Mf(2,gno1)*Mf(2,gno2) + 
     &             dup46*dup47*Mf2(2,gno1))*
     &           Re(B1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2)))))/
     &      (CB2*CW2*MW2*SW2*(Mf2(2,gno1) - Mf2(2,gno2)))

	ENDLOOP(All3)
	ENDLOOP(Neu3)

#ifdef DETAILED_DEBUG
	DCOUP "hee-RenConst: dZfL1(2,gno2,gno1) =", dZfL1(2,gno2,gno1) ENDL
#endif

	dZfR1(2,gno2,gno1) = 0

	LOOP(Neu3, 1,4,1)
	LOOP(All3, 1,6,1)

	dup49 = SW*ZNeu(Neu3,1) + CW*ZNeu(Neu3,2)

	dup50 = SW*ZNeuC(Neu3,1) + CW*ZNeuC(Neu3,2)

        dup51 = 2*CB*MW*SW*UASf(All3,3 + gno1,2)*
     &     ZNeu(Neu3,1) + CW*Mf(2,gno1)*UASf(All3,gno1,2)*
     &     ZNeu(Neu3,3)

        dup52 = CB*dup49*MW*UASfC(All3,gno2,2) - 
     &    CW*Mf(2,gno2)*UASfC(All3,3 + gno2,2)*ZNeu(Neu3,3)

        dup53 = CB*dup50*MW*UASf(All3,gno1,2) - 
     &    CW*Mf(2,gno1)*UASf(All3,3 + gno1,2)*ZNeuC(Neu3,3)

        dup54 = 2*CB*MW*SW*UASfC(All3,3 + gno2,2)*
     &     ZNeuC(Neu3,1) + 
     &    CW*Mf(2,gno2)*UASfC(All3,gno2,2)*ZNeuC(Neu3,3)

        dZfR1(2,gno2,gno1) = 
     &   dZfR1(2,gno2,gno1) + 
     &    1/(4.D0*Pi)*(AlfaMZ*
     &        ((dup53*dup54*Mf(2,gno1) + dup51*dup52*Mf(2,gno2))*
     &           MNeu(Neu3)*
     &           Re(B0(Mf2(2,gno1),MASf2(All3,2),MNeu2(Neu3))) + 
     &          (dup52*dup53*Mf(2,gno1)*Mf(2,gno2) + 
     &             dup51*dup54*Mf2(2,gno1))*
     &           Re(B1(Mf2(2,gno1),MNeu2(Neu3),MASf2(All3,2)))))/
     &      (CB2*CW2*MW2*SW2*(Mf2(2,gno1) - Mf2(2,gno2)))

	ENDLOOP(All3)
	ENDLOOP(Neu3)

#ifdef DETAILED_DEBUG
	DCOUP "hee-RenConst: dZfR1(2,gno2,gno1) =", dZfR1(2,gno2,gno1) ENDL
#endif

	endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end

